import React , {Component} from 'react';

class App extends Component {

    constructor(){
        super()
        this.state = {
            number:0
        }
        
        this.clickHandler
    }

    clickHandler(){
        this.setState({
            number:1
        })
    }
    

    render(){
        return(
            <div className='container text-center mt-5  '>
                <h1 className='mb-5'>{this.state.number}</h1>
                <button className='btn btn-primary p-3 rounded-pill' onClick={this.clickHandler}>Click</button>
            </div>
           
        )
    }
}

export default App;
